INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Tobias Menzies', '1974-03-07', 'London, England, UK', 'nm0580014', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjMxMzU0NTIxMl5BMl5BanBnXkFtZTgwOTE4ODAzMjE@._V1_.jpg', 'Tobias was born in London. He graduated from the Royal Academy of Dramatic Art (RADA) in 1998 and began his acting career in popular UK series such as Foyle\'s War, Midsomer Murders, and Casualty. He also appeared in the controversial drama A Very Social Secretary.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Lara Pulver', '1980-09-01', 'Southend-on-Sea, Essex, England, UK', 'nm3091498', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTQ5NzUwMjM4MV5BMl5BanBnXkFtZTgwNDA1MTA1MDE@._V1_.jpg', 'Lara was born and raised in Essex, UK. She studied drama with the NYMT and went on to gain a BA Honors degree in Theatre.Lara\'s extensive theatre career led her to gain a Laurence Olivier Award nomination for her portrayal of "Lucille Frank" in Rob Ashford\'s production of "Parade" at The Donmar Warehouse.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Charles Dance', '1946-10-10', 'Redditch, Worcestershire, England, UK', 'nm0001097', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMzY0Mjg4MzM0Ml5BMl5BanBnXkFtZTcwODc4NTIxNw@@._V1_.jpg', 'Charles Dance is an English actor, screenwriter, and film director. Dance typically plays assertive bureaucrats or villains. Some of his most high-profile roles are Tywin Lannister in HBO\'s "Game of Thrones", Guy Perron in "The Jewel in the Crown", Sardo Numspa in "The Golden Child", Dr.');
