INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Brad Martin', '1970-01-14', 'San Francisco, California, USA', 'nm0551997', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTU5MDIwOTEzMV5BMl5BanBnXkFtZTcwMDE3NDMzMQ@@._V1_.jpg', 'Brad Martin is a native of Sun Valley, Idaho. He grew up alpine ski racing on an international level and practicing martial arts (he has his Black Belt Tae Kwon Do and well versed in numerous other styles) as well as mastering other sporting and athletic endeavors.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Matt Mullins', '1980-11-10', 'Naperville, Illinois, USA', 'nm1280538', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTg5NTc5MTY1NF5BMl5BanBnXkFtZTgwMzU2MzAxMDI@._V1_.jpg', 'From his humble beginnings of watching Teenage Mutant Ninja Turtles, Matt Mullins has risen to become world renown in martial arts, and as a star in the CW4Kids show "Kamen Rider: Dragon Knight".With 5 martial art world titles in hand, Matt moved from Naperville, IL to Hollywood and quickly began booking national spots for top brands such as Nike, Burger King, and Pepsi, with his most recent being the Ultra Sexy Motorola RAZR 2 commercial.');
