INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Alicia Vela-Bailey', '1982-07-08', 'Alameda County, California, USA', 'nm2151188', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTk5MDY2OTAwNV5BMl5BanBnXkFtZTgwOTM0NzQ2OTE@._V1_.jpg', 'As the most inspirational and diverse action actor of recent years, Alicia Vela-Bailey has emerged from A list stunt double to on screen sensation. Whether it is her chilling performance as Diana in the smash hit "Lights Out" or her acrobatic, ass kicking, portrayal of Alisha Whitley on Marvel\'s Agents of Shield, it is clear Alicia Vela-Bailey truly is the human special effect.');
