INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Kristof Konrad', '1975-04-26', 'Gizycko, Warminsko-Mazurskie, Poland', 'nm0465311', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjY0MDEwMTg3Nl5BMl5BanBnXkFtZTgwMzAyNTI5OTE@._V1_.jpg', 'Kristof Konrad, real name - Krzysztof Wojslaw (born April 26, 1975 in Gizycko, Poland) is a Polish film, television and theater actor. He studied to become an electronic engineer at first but later entered The National Theatre Academy in Warsaw. There he studied and worked with theatre and film masters Jerzy Grotowski and Andrzej Wajda.');
